import blog1 from './../../resm/logo01jpg';
import blog2 from './../../resm/logo02.png';
import blog3 from './../../resm/logo04.jpg';
import blog4 from './../../resm/012.jpg';
import blog5 from './../../resm/016.jpg';



const Data =[
    {
        img : blog1,
        title :"Logo",
    },
    {
        img : blog2,
        title :'logo',
    },
    {
        img :blog3,
        title :'logo',
    },
    {
        img : blog4,
        title :'Brochure',
    },
    {
        img : blog5,
        title :'Brochure',
    }
]
export default Data;
